package returnTypeTest;

public class ReturnTest1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	
int result = add()*sub();
System.out.println(result);
	}
	public static int add() {
		int i=10;
		int j=20;
		int k =i+j;
		return k;
		
	}

	public static int sub() {
		int i=10;
		int j=20;
		int k =j-i;
		return k;
		
		
		
	}
	
	
}
